        colors: ['#01BAF2', '#71BF45', '#FAA74B', '#B37CD2'],
        chart: {
            type: 'pie'
        },
        title: {
            text: 'Air composition'
        },
        tooltip: {
            valueSuffix: '%'
        },
        plotOptions: {
            pie: {
                allowPointSelect: false,
                cursor: 'pointer',
                dataLabels: {
                    enabled: false,
                    format: '{point.name}: {y} %'
                },
                showInLegend: false
            }
        },
        series: [{
            name: 'Percentage',
            colorByPoint: true,
            innerSize: '75%',
            data: [{
                name: 'primeiro',
                y: 78
            }, {
                name: 'segundo',
                y: 20.9
            }, {
                name: 'Other gases',
                y: 1.1
            }]
        }]
    });
